### Sum And Max
```
class SumAndMax {

    int sum;
    int max;

    /*@ normal_behaviour
      @   requires R1: (\forall int i; 0 <= i && i < a.length; 0 <= a[i]);
      @   assignable sum, max;
      @   ensures E1: (\forall int i; 0 <= i && i < a.length; a[i] <= max);
      @   ensures E2: (a.length > 0
      @           ==> (\exists int i; 0 <= i && i < a.length; max == a[i]));
      @   ensures E3: sum == (\sum int i; 0 <= i && i < a.length; a[i]);
      @   ensures E4: sum <= a.length * max;
      @*/
    void sumAndMax(int[] a) {
        sum = 0;
        max = 0;
        int k = 0;

        /*@ loop_invariant I1: 0 <= k && k <= a.length;
          @ loop_invariant I2: (\forall int i; 0 <= i && i < k; a[i] <= max);
          @ loop_invariant I3: (k == 0 ==> max == 0);
          @ loop_invariant I4: (k > 0 ==> (\exists int i; 0 <= i && i < k; max == a[i]));
          @ loop_invariant I5: sum == (\sum int i; 0 <= i && i< k; a[i]);
          @ loop_invariant I6: sum <= k * max;
          @
          @  assignable sum, max;
          @  decreases a.length - k;
          @*/
        while(k < a.length) {
            if(max < a[k]) {
                max = a[k];
            }
            sum += a[k];
            k++;
        }
    }
}
```

### Introduction of Abbreviations for Named Terms 

`Menu: Proof-> Introduce abbreviation for named formulas`

Before:

![image](https://user-images.githubusercontent.com/104259/216825923-3b9c60f8-0a12-4d4e-9980-424ef2143191.png)

After actions is applied:

![image](https://user-images.githubusercontent.com/104259/216825936-306b20c6-688a-40d9-954c-d274846228bb.png)

Extension of the KeY grammar to allow the definition of ADTs. 

The grammar for ADTs follows the typical defintions in KeY. ADTs are defined within a `\datatypes { ... }` block, and are translated onto the existing infrastructure (Sorts, Functions, Taclets). The grammar is as follows:

```
\datatypes {
   <name> := <constructor> | ... | <constructor>;
   ...
 }
```

where constructor is a function definition `<cname>( <sort> <argName>, ...)`. 

Currently, three taclets are generated for each datatype definiton:

1. Axiom taclets that adds the induction as an axiom on the sequence 

$$
\frac{
(\forall a \in ADT.~ \phi) \leftrightarrow  \phi[a/c_1] \wedge \ldots \wedge \phi[a/c_n] 
\Longrightarrow
}{
\forall a \in ADT.~ \phi[a]
}
$$

2. Induction taclets for proving a sentence for all ADTs.

$$
\frac{
\begin{matrix}
   \forall a \in ADT; \phi \Longrightarrow \\
   \Longrightarrow \phi[a/c_1]  \\
   \Longrightarrow \ldots      \\
   \Longrightarrow phi[a/c_n]
\end{matrix}
}{
\Longrightarrow \forall a \in ADT.~ \phi[a]
}
$$

   A direct consequence of the induction formula in (1).

4. A case distinction taclet
  
   This is a direct consequence of the disjunction $x = c_1 \vee\ldots\vee x = c_n$ resulting from the construction principles of ADTs. This allows us to make a case distinction about the various constructors. Note, the constructor parameters are need to existential bounded. 

$$
\frac{
\begin{matrix}
   x = c_1      \Longrightarrow \\
   \ldots    \Longrightarrow    \\
   x = c_n   \Longrightarrow 
\end{matrix}
}{
     x : ADT ~ \text{(anywhere)}
}
$$




### Example

**Input**
```
\datatypes {
  MyList = MNil | MCons(any head, MyList tail);
}
```

**Generated Taclets**

```
MyList_Axiom {
    \schemaVar \formula phi;
    \schemaVar \variables MyList x;
    
    \find(\forall x; phi)
    \varcond(\notFreeIn(x, phi))
    \add(
             \forall x; phi
         <->   {\subst x;MNil}phi
             & \forall tail; \forall head; ({\subst x;tail}phi -> {\subst x;MCons(head, tail)}phi)
        ==>
      )
    \displayname "Axiom for MyList"
  }

MyList_Ind {
       \schemaVar \formula phi;
       
       "MNil":
           \add(==> {\subst x;MNil}phi);
       "MCons(anyhead,MyListtail)":
           \add(
               ==>
                \forall tail; \forall head; ({\subst x;tail}phi -> {\subst x;MCons(head, tail)}phi)
             );
       "Use case of MyList":
           \add(\forall x; phi ==>)
       \displayname "Induction for MyList"
     }

MyList_ctor_split {
          \schemaVar \term MyList var;
          \schemaVar \skolemTerm any head;
          \schemaVar \skolemTerm MyList tail;
          
          \find(var)
          \sameUpdateLevel
          "#var = MNil":
              \add(var = MNil ==>);
          "#var = MCons":
              \add(var = MCons(head, tail) ==>)
          \displayname "case distinction of MyList"
        }
```

